import React from 'react';
import { Box, TextField, Button, Typography, Stack, Fade } from '@mui/material';

interface RegisterProps {
  onBack: () => void;
}

export default function Register({ onBack }: RegisterProps) {
  return (
    <Fade in>
      <Box
        component="form"
        sx={{
          maxWidth: 400,
          width: '100%',
          p: 3,
          borderRadius: 3,
          boxShadow: 3,
          bgcolor: 'white',
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
        }}
      >
        <Stack spacing={2} sx={{ width: '100%' }}>
          <TextField label="Электронный адрес" variant="outlined" fullWidth />
          <TextField label="Логин" variant="outlined" fullWidth />
          <TextField label="Пароль" type="password" fullWidth />
          <TextField label="Подтверждение пароля" type="password" fullWidth />

          <Button
            variant="contained"
            fullWidth
            sx={{
              borderRadius: '25px',
              py: 1.2,
              fontWeight: 'bold',
              bgcolor: 'green',
              '&:hover': { bgcolor: 'darkgreen', transform: 'scale(1.02)' },
              transition: '0.3s',
            }}
          >
            Зарегистрироваться
          </Button>

          <Typography
            variant="body2"
            sx={{ textAlign: 'center', cursor: 'pointer', color: 'primary.main' }}
            onClick={onBack}
          >
            Назад к авторизации
          </Typography>
        </Stack>
      </Box>
    </Fade>
  );
}
